import { Link } from "react-router-dom";

const Footer = () => {
    return (
        <>
       
          <div className="container">
            <div className="row">
                <div className="col-md-6 col-lg-4">
                    <ul>
                    <li class="lisize"><i class="fa-solid fa-mobile-screen pe-1"></i> <Link to="#" class="overcolor">005-01008431112</Link> </li></ul>
                </div>
                <div className="col-md-6 col-lg-4"></div>
                <div className="col-md-6 col-lg-4"></div>
            </div>
          </div>



        </>
    )
  }
  
  export default Footer
